package com.skyworth.iDtv.entity;import java.io.Serializable;public class UserTypeData implements Serializable {	private static final long serialVersionUID = 6867651722736311882L;	private int id;	private String typeName;	private int addDevicePermission;	private int addUserPermission;	private int addManagerPermission;	public int getAddUserPermission() {		return addUserPermission;	}	public void setAddUserPermission(int addUserPermission) {		this.addUserPermission = addUserPermission;	}	public int getAddManagerPermission() {		return addManagerPermission;	}	public void setAddManagerPermission(int addManagerPermission) {		this.addManagerPermission = addManagerPermission;	}	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getTypeName() {		return typeName;	}	public void setTypeName(String typeName) {		this.typeName = typeName;	}	public int getAddDevicePermission() {		return addDevicePermission;	}	public void setAddDevicePermission(int addDevicePermission) {		this.addDevicePermission = addDevicePermission;	}}